import React from 'react';

export default function CredentialsContainer() {
    const submit = (e) => {
        e.preventDefault();

        const form = document.getElementById('credentials');
        const formData = new FormData(form);

        var object = {};
        formData.forEach(function (value, key) {
            object[key] = value;
        });

        const requestOptions = {
            method: 'PUT',
            body: JSON.stringify(object),
            headers: {
                'Content-Type': 'application/json'
            }
        }

        fetch(uri, requestOptions)
            .then(response => response.json())
            .then(function (data) {
                response = data;
            })
            .catch(function (error) {
                response.success = false;
                response.message = error + "";
                response.data = null;
            })
            .finally(function () {
                resolve(response);
                store.dispatch(StopLoadAction());
            });
    }

    return (
        <React.Fragment>
            {snackbar}
            <form onSubmit={(e) => submit(e)} id='credentials'>
                <label>Key</label>
                <input name='key' required />
                <label>Shared Secret</label>
                <input name='shared_secret' required />
                <button type='submit'>Add Credentials</button>
            </form>
        </React.Fragment>
    );
}
